import React from 'react';
import Card from './Card';

const CardList = ({ pokemons }) => {
	const cardComponent = pokemons.map((user, index) => 
		<Card id = {pokemons[index].id} name={pokemons[index].name} img ={pokemons[index].img}/>);
	return (
		<div>
			<h1 className='tc'> Pokemon Index </h1>
    		cardComponent;
		</div>
	);
};

export default CardList;
